import React, { useState } from "react";
import { Box, Container, Grid } from "@material-ui/core";
import Caption from "../Typography/Caption";
import Title from "../Typography/Title";
import ProfileImage from "../Images/ProfileImage";
import Body from "../Typography/Body";

function OurTeam() {
  const [team] = useState([
    {
      image: "/assets/somick.png",
      name: "SEWMEHON YISMAW",
      position: "Director, Cinematographer, Manager",
    },
    { image: "/assets/emp2.png", name: "ERMIYAS GIRMA", position: "Producer" },
    {
      image: "/assets/emp3.png",
      name: "YOHANNES TESEMA",
      position: "Cinematographer",
    },
    {
      image: "/assets/emp4.png",
      name: "BRUKTAWIT FIKADU",
      position: "Editor, Actor",
    },
  ]);
  return (
    <Container>
      <Grid container direction="column" alignItems="center" spacing={2}>
        <Grid item>
          <Caption>Our Team</Caption>
        </Grid>
        <Grid item>
          <Title>MEET OUR TEAM</Title>
        </Grid>
        <Box clone width="100%">
          <Grid item>
            <Grid container spacing={5}>
              {team.map((item, key) => (
                <Grid key={key} xs={12} sm={6} md={3} item>
                  <Box
                    display="flex"
                    flexDirection="column"
                    alignItems="center"
                  >
                    <ProfileImage src={item.image} />
                    <Title pt={4} pb={1} sm>
                      {item.name}
                    </Title>
                    <Body textAlign="center">{item.position}</Body>
                  </Box>
                </Grid>
              ))}
            </Grid>
          </Grid>
        </Box>
      </Grid>
    </Container>
  );
}

export default OurTeam;
